import "./App.css";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter as Router,Routes,Route} from "react-router-dom";

import Navbar from "./components/Navbar";

import DoctorDashboard from "./Pages/Ddashboard";

import PreviousAppointments from "./Pages/Appointment";
import UploadSchedule from "./Pages/uploadschedule";
import SideNavbar from "./components/sidenavbar";
import Particles from "react-tsparticles";

function App() {

  return (

      <Router>
        <Particles
        id="tsparticles"
        options={{
          background: {
            color: {
              value: "#0d47a1",
            },
          },
          fpsLimit: 60,
          interactivity: {
            detectsOn: "canvas",
            events: {
              onClick: {
                enable: true,
                mode: "push",
              },
              onHover: {
                enable: true,
                mode: "repulse",
              },
              resize: true,
            },
            modes: {
              bubble: {
                distance: 400,
                duration: 2,
                opacity: 0.8,
                size: 40,
              },
              push: {
                quantity: 4,
              },
              repulse: {
                distance: 200,
                duration: 0.4,
              },
            },
          },
          particles: {
            color: {
              value: "#ffffff",
            },
            links: {
              color: "#ffffff",
              distance: 150,
              enable: true,
              opacity: 0.5,
              width: 1,
            },
            collisions: {
              enable: true,
            },
            move: {
              direction: "none",
              enable: true,
              outMode: "bounce",
              random: false,
              speed: 6,
              straight: false,
            },
            number: {
              density: {
                enable: true,
                value_area: 800,
              },
              value: 80,
            },
            opacity: {
              value: 0.5,
            },
            shape: {
              type: "circle",
            },
            size: {
              random: true,
              value: 5,
            },
          },
          detectRetina: true,
        }}
      />

        <Navbar/>
        <SideNavbar/>

      <Routes>

        <Route exact path = "/ddashboard" element = {<DoctorDashboard/>}/>
        <Route exact path = "/ddashboard/appointment" element = {<PreviousAppointments/>}/>
        <Route exact path = "/ddashboard/upload"  element = {<UploadSchedule/>}/>
      </Routes>


      </Router>




  );
}

export default App;
